import { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';

import api from '../../services/api';

function Filme(){
    const{id}=useParams();

    useEffect(()=>{
        async function loadFilme(){
            await api.get(`/movie/${id}`)
        }
    },[])

    return(
        <div>
            <h1>ACESSANDO FILME {id}</h1>
        </div>
    )
};

export default Filme;
